**Union City Bart站旁3B2B.5BTownhouse中的两个房间出租，一个即可入住。另一间12月底入住。
- 小区环境安全优美，房子是新房。家里各类健身装备，以及小区游泳池均可免费使用;
- 交通非常便利，步行距离即可到达Union City Bart站，各种公交站，开车5分钟即上880, 84号公路；
- 生活便利，步行15分钟范围内即可到达永和，Safeway，Daiso， Dollar Tree等购物超市;
- 步行15分钟范围内即有包括上海菜，川菜，粤菜，港式，台湾菜，小肥羊等各类中餐馆，以及奶茶，甜品，冷饮，蛋糕店等;
- 步行距离即可到达环境优美的Quarry Lakes Regional Park，Charles F Kennedy Park, Union City Pyramid等休闲娱乐好去处;
- 希望找到靠谱，呆萌，好相处的室友。联系微信：qdy490233677或电话4154380681
